import React from "react";
import "./CourseGoalItem.css";

const CourseGoalItem = () => {
  return (
    <>
      <li className="goal-item" onClick="">{props.children}</li>
      <li className="goal-item">This Is My Second List</li>
    </>
  );
};

export default CourseGoalItem;
